const ProductsList = () => {
    return (  
        <>
            <span className="mx-3 mb-2 text-sm font-bold raleway">Liste de produits</span>
            <div className="border-2 w-80 h-40 rounded-xl">
                <div>
                    <div></div>
                    <div>
                        <span>Amoxicillin Capsules BP - 500mg x 21</span>
                        <div>
                            <span>600 </span>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}
 
export default ProductsList;
